
import streamlit as st
import pandas as pd

st.set_page_config(page_title="Maintenance Tracker - Rugaib", layout="centered")

st.markdown("""
<div style="text-align:center; margin-bottom:20px;">
  <img src="data:image/png;base64," style="max-height:80px;">
</div>
""", unsafe_allow_html=True)
st.markdown("<h2 style='text-align:center; color:#333;'>🛠️ Maintenance Tracker - Rugaib</h2>", unsafe_allow_html=True)

st.markdown("<p style='text-align:center; color:#666;'>Enter Mobile Number or Invoice Number:</p>", unsafe_allow_html=True)
user_input = st.text_input("", placeholder="05XXXXXXXX or Invoice #")

@st.cache_data
def load_data():
    url = "https://docs.google.com/spreadsheets/d/1MitHqD5SZfm-yAUsrc8jkki7zD9zFlH1JXhHTKjfAhs/export?format=csv"
    return pd.read_csv(url)

df = load_data()

if st.button("Search"):
    if user_input.strip() == "":
        st.warning("Please enter a mobile number or invoice number.")
    else:
        results = df[
            (df["رقم الجوال"].astype(str) == user_input) |
            (df["رقم الفاتورة"].astype(str) == user_input)
        ]
        if not results.empty:
            for _, row in results.iterrows():
                st.markdown(
                    f'''
                    <div style='border:1px solid #ccc; padding:20px; border-radius:10px; background-color:#f9f9f9; text-align:right;'>
                    <strong>الاسم:</strong> {row["اسم العميل"]}<br>
                    <strong>رقم الجوال:</strong> {row["رقم الجوال"]}<br>
                    <strong>رقم الفاتورة:</strong> {row["رقم الفاتورة"]}<br>
                    <strong>العنوان:</strong> {row["العنوان"]}<br>
                    <strong>تحديث D365:</strong> {row["تحديث D365"]}
                    </div>
                    ''',
                    unsafe_allow_html=True
                )
        else:
            st.error("No matching records found.")

st.markdown("<hr>", unsafe_allow_html=True)
st.caption("© Hamad M. Al Rugaib & Sons Trading Co. – Powered by Streamlit")
